import Newsheader from './news_header/newheader';
import Moinhat from './news_mn/news_mn';
import Xuhuong from './news_xuhuong/xuhuong';
import Xahoi from './news_xahoi/Xahoi';
import Kinhte from './news_kt/news_kt';
import Doisong from './news_ds/news_ds';
import Video from './news_video/news_video';
import Picture from './news_anh/news_anh';

function Container() {
    return ( <
        div id = "container" >
        <
        div className = "body_main" >
        <
        div className = "main_left" >
        <
        Newsheader / >
        <
        Xuhuong / >
        <
        Moinhat / >
        <
        Xahoi / >
        <
        Kinhte / >
        <
        Doisong / >
        <
        /div> <
        div class = "main_right" >
        <
        Video / >
        <
        Picture / >
        <
        Audio / >
        <
        /div> <
        /div> <
        /div>
    );
}
export default Container;
